import React from 'react';
import Form from './Form';

function Div1(){
    return(
        <>
    <div className="form">
       <Form/>
            <a href="https://github.com/Dikshit-byte/My-Favourite-Projects" target="_blank">
            <button type="submit" id="submit">Submit</button>
        </a>
        </div>
        </>
    );
}

export default Div1;
